class Pokemon extends Component {
  render() {
    const {
      id,
      name,
      type,
      averageWeight: { value, measurementUnit },
      image,
    } = this.props.pokemon;
    console.log(id, name, type, value, measurementUnit);
    return (
      <li>
        <h2>Name</h2>
        <h3>Type</h3>
        <p>Description: Body mass</p>
      </li>
    )
  }
}

export default Pokemon;
